const RemixComponent = () => {
  return (
    <Box>
       <Box
        display='flex'
        flexDirection='row'
      >
        number
        cover
      </Box>

      <Box
        id='remix-title-artist'
      >
        title
        artist
      </Box>
    </Box>
  ) 
}

export default RemixComponent;
